    true,nt"url": null,nt"notes": "The Consolidated State Performance Report,
    2004-05 (CSPR 2004-05), is part of the Consolidated State Performance Report (CSPR)
    program: a required annual reporting tool for each state, the District of Columbia,
    the Bureau of Indian Education, and Puerto Rico; program data is available since
    2005-06 at <http://www2.ed.gov/admins/lead/account/consolidated/index.html>. CSPR
    2004-05 (http://www2.ed.gov/admins/lead/account/consolidated/index.html) is a cross-sectional
    survey that measures each state's progress towards implementation of the No Child
    Left Behind Act (NCLB) and the reporting instrument for state formula grant programs
    authorized by the Elementary and Secondary Education Act (ESEA) as amended by NCLB.
    The reporting was conducted using questionnaires of state education agencies (SEAs).
    CSPR 2004-05 is a universe survey. The study's response rate was 100%. Key statistics
    include information on adequate yearly progress, state performance assessments,
    highly qualified teachers, public school choice and supplemental education services
